import React, { useState } from 'react';
import ScoreCard from '../HomeCompo/ScoreCard';
import PlayerList from '../HomeCompo/PlayerList';

export default function ClientPanel() {
  const [scoreData, setScoreData] = useState({
    homeTeam: 'Red Dragons',
    awayTeam: 'Blue Tigers',
    homeScore: 0,
    homeWickets: 0,
    awayScore: 0,
    awayWickets: 0,
    overs: 0,
    homePlayers: Array(11).fill({ name: '', runs: 0, balls: 0, fours: 0, sixes: 0 }),
    awayPlayers: Array(11).fill({ name: '', runs: 0, balls: 0, fours: 0, sixes: 0 }),
    homeBowlers: Array(11).fill({ name: '', overs: 0, maiden: 0, runsGiven: 0, wickets: 0 }),
    awayBowlers: Array(11).fill({ name: '', overs: 0, maiden: 0, runsGiven: 0, wickets: 0 })
  });

  // Handle player name input change for batsmen and bowlers
  const handleNameChange = (teamType, playerType, index, value) => {
    setScoreData(prevState => {
      const updatedPlayers = [...prevState[teamType]];
      updatedPlayers[index] = {
        ...updatedPlayers[index],
        name: value,
      };
      return {
        ...prevState,
        [teamType]: updatedPlayers
      };
    });
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <h1 className="text-3xl font-bold mb-8">Cricket Live Score</h1>
      <div className="max-w-4xl mx-auto">
        <ScoreCard
          homeTeam={scoreData.homeTeam}
          awayTeam={scoreData.awayTeam}
          homeScore={scoreData.homeScore}
          homeWickets={scoreData.homeWickets}
          awayScore={scoreData.awayScore}
          awayWickets={scoreData.awayWickets}
          overs={scoreData.overs}
        />
        
        {/* Home Team Batsmen */}
        <h2 className="text-2xl font-bold mb-4">{scoreData.homeTeam} Batsmen</h2>
        {scoreData.homePlayers.map((player, index) => (
          <div key={index} className="mb-2">
            <label>Batsman {index + 1} Name:</label>
            <input
              type="text"
              value={player.name}
              onChange={(e) => handleNameChange('homePlayers', 'batsman', index, e.target.value)}
              className="border p-2 ml-2"
            />
          </div>
        ))}

        {/* Away Team Batsmen */}
        <h2 className="text-2xl font-bold mb-4">{scoreData.awayTeam} Batsmen</h2>
        {scoreData.awayPlayers.map((player, index) => (
          <div key={index} className="mb-2">
            <label>Batsman {index + 1} Name:</label>
            <input
              type="text"
              value={player.name}
              onChange={(e) => handleNameChange('awayPlayers', 'batsman', index, e.target.value)}
              className="border p-2 ml-2"
            />
          </div>
        ))}

        {/* Home Team Bowlers */}
        <h2 className="text-2xl font-bold mb-4">{scoreData.homeTeam} Bowlers</h2>
        {scoreData.homeBowlers.map((player, index) => (
          <div key={index} className="mb-2">
            <label>Bowler {index + 1} Name:</label>
            <input
              type="text"
              value={player.name}
              onChange={(e) => handleNameChange('homeBowlers', 'bowler', index, e.target.value)}
              className="border p-2 ml-2"
            />
          </div>
        ))}

        {/* Away Team Bowlers */}
        <h2 className="text-2xl font-bold mb-4">{scoreData.awayTeam} Bowlers</h2>
        {scoreData.awayBowlers.map((player, index) => (
          <div key={index} className="mb-2">
            <label>Bowler {index + 1} Name:</label>
            <input
              type="text"
              value={player.name}
              onChange={(e) => handleNameChange('awayBowlers', 'bowler', index, e.target.value)}
              className="border p-2 ml-2"
            />
          </div>
        ))}
      </div>
    </div>
  );
}
